  const onChangeId = () => {};

  return (
    <>
      <Form>
        <div>
          <label htmlFor="user-id">ID</label>
          <br />
          <Input
            name="user-id"
            value={id}
            onChange={onChangeId}
            required
          ></Input>
        </div>
        <label htmlFor="user-pw">Password</label>
        <br />
        <Input name="user-pw" value={pw} onChange={onChangePw} required></Input>
        <div></div>
        <div></div>
        <div></div>
      </Form>
    </>
  );
};

export default LoginForm;
